import * as React from 'react';
import { Routes, Route, Link } from "react-router-dom";
import Home from './routes/Home'; 
import Votaciones from './routes/Votaciones';
import Pagestate from './routes/Pagestate';
import Reservas from './routes/Reservas';
import Foros from './routes/Foros';
import Conserjeria from './routes/Conserjeria';
import HomeSesion from './routes/HomeSesion';
import './assets/styles/custom.css'

export default function App() {
  return (
    <div style={{width: '1024px', margin: 'auto', marginTop: '20px'}}>
      <div className='row' style={{ float: "right", }}>
        <nav className='col-md-12 float-right'>
          <Link to="/Home">Home |</Link> 
          <Link to="/Pagestate">Page of state |</Link>
          <Link to="/Reservas">Reservas |</Link>
          <Link to="/Foros">Foros |</Link>
          <Link to="/Votaciones">Votaciones |</Link>
          <Link to="/Conserjeria">Conserjería |</Link>
          <Link to="/HomeSesion">Home de Sesión</Link> 
        </nav>  
      </div>

      <Routes>
        {/* <Route path="Home" element={<Home />}/> */}
        <Route path="Pagestate" element={<Pagestate />} />
        <Route path="Reservas" element={<Reservas />} />
        <Route path="Foros" element={<Foros/>} />
        <Route path="Votaciones" element={<Votaciones/>} />
        <Route path="Conserjeria" element={<Conserjeria/>} />
        <Route path="HomeSesion" element={<HomeSesion />} />
      </Routes>
    </div>
  );
}
